function getBankName(obj)
{
	var cardNumber=$(obj).val();
	var cardNumSix=parseInt(cardNumber.substr(0,6));
	
	if(bankList[cardNumSix])
	{
		var bankName=bankList[cardNumSix];
		var textObj=$(".text-desc");
		var textCon=textObj.val();
		if(!textCon.match(bankName))
		{
			textObj.val('【'+bankName+'】'+textCon);
		}		
	}	
}
